pragma solidity 0.8.10;

import "./lib/DynamicNFTFactory.sol";

contract WeaponNFTFactory is DynamicNFTFactory {
    string[] public meta;

    struct Weapon {
        uint level;
        uint damage;
        uint agility;
    }

    mapping(uint => Weapon) public weapons;

